"use strict";const baseUrl="http://localhost:3000/notes",getNoteById=t=>new Promise((e,o)=>{fetch(baseUrl+"/"+t,{method:"GET"}).then(t=>{e(t.json())}).catch(t=>{o(t)})}),init=()=>{const t=location.pathname.split("/notes/view/")[1];getNoteById(t).then(t=>{console.log(t)}).catch(t=>{console.log(t)})};document.addEventListener("DOMContentLoaded",init,!1);